	// * size == size$R ^ d
	// * but this does
	// * size() == size$R ^ d
	// *
	// * or, for infix operators,
	// * a = b == statement
	// * or, for multiple statements,
	// * name(params) == {
	// * statement
	// * statement
	// * }
	// * some function definitions may be conditional like this:
	// * if % has finiteAggregate then {
	// * ... }
	// * / FunctionDefinition hidden(WS, SL_COMMENT):
